import React, { Component } from 'react'
import PropTypes from 'prop-types'
import './Form2.css'

export class Form2 extends Component {
    
    constructor(props){
        super(props)

        this.state={
            studentName:'',
            mobileNumber:'',
            email:'',
            password:'',
            stream:'CSE'

        }

       

    }

    handleStudentNameChange=(event)=>{
        this.setState({
            studentName:event.target.value
        })     
    }

    handleMobileNumberChange=(event)=>{
        this.setState({
            mobileNumber:event.target.value
        })     
    }

    handleEmailChange=(event)=>{
        this.setState({
            email:event.target.value
        })     
    }

    handlePasswordChange=(event)=>{
        this.setState({
            password:event.target.value
        })     
    }

    handleStreamChange=(event)=>{
        this.setState({
            stream:event.target.value
        })     
    }
   
    handleSubmit=(event)=>{
        alert('Submitted')
    }

    render() {
        return (
            <div className="formStyle">
                <form onSubmit={this.handleSubmit}>
                    <legend>Book multiple free demo classes !!</legend>
                    <div>
                        <label >Student Name: 
                        <input type="text"  placeholder="Enter Name" value={this.state.studentName} onChange={this.handleStudentNameChange}/>
                        </label>
                    </div>
                    <div>
                        <label  >Email Address: 
                        <input  type="email"  placeholder="Enter email address" value={this.state.email} onChange={this.handleEmailChange}/>
                        </label>
                    </div>
                    <div>
                        <label >Password: 
                        <input type="password" placeholder="Enter Password" value={this.state.password} onChange={this.handlePasswordChange}/>
                        </label>
                    </div>
                    <div>
                        <label>Mobile Number: 
                        <input  type="text" placeholder="Enter Mobile No." value={this.state.mobileNumber} onChange={this.handleMobileNumberChange}/>
                        </label>
                    </div>
                    <div>
                        <label>Stream: 
                        <select value={this.state.stream} onChange={this.handleStreamChange}>
                            <option value="CSE">CSE</option>
                            <option value="CE">CE</option>
                            <option value="ECE">ECE</option>
                            <option value="MECH">MECH</option>
                        </select>
                        </label>
                    </div>
                    

                    <input type="submit" value="Submit" />
                </form>
            </div>
        )
    }
}

export default Form2
